var side = ['RIGHT','LEFT']
var freq = ['1KT','500','1K','2K','3K','4K','6K','8K']
var count = {RIGHT:0,LEFT:0}
var countfreq = {RIGHT:0,LEFT:0}
var counterr = {RIGHT:0,LEFT:0}
for(var i=0;i<side.length;i++) {
  var s = side[i]
  var v = 'clsa-dcs.Hearing:RES_' + s + '_'
  for(var j=0;j<freq.length;j++) {
    var f = v + freq[j]
    if ($(f).isNull().not().or($(f + '_ERR').isNull().not()).value()) count[s]++;
    if ($(f).isNull().not().value()) countfreq[s]++;
    if ($(f + '_ERR').isNull().not().value()) counterr[s]++;
  }
}
res = (0 == count.RIGHT && 0 == count.LEFT && 
  $('clsa-dcs.Hearing:RES_TEST_ID').isNull().and(
    $('clsa-dcs.Hearing:RES_TEST_DATETIME').isNull()).value()) ?
      null : newValue(
        '{response_left:'+count.LEFT+
        ',response_right:'+count.RIGHT+
        ',error_left:'+(counterr.LEFT>0 && countfreq.LEFT==0 ? '1' : '0')+
        ',error_right:'+(counterr.RIGHT>0 && countfreq.RIGHT==0 ? '1' : '0')+
        '}','text')

