var res=null
if(tt.isNull().not().value()) {
  var wt=$('clsa-dcs.4mWalk:WLK_TIME').whenNull($('clsa-dcs.4mWalk:WLK_TIME_2'))  
  var ct=$('clsa-dcs.ChairRise:CR_TIME').whenNull($('clsa-dcs.ChairRise:CR_TIME_2'))  
  var str = '0'
  if(tt.isNull().not().and(ct.isNull().not()).value()) {
    var cv=ct.div($('clsa-dcs.ChairRise:CR_NB').whenNull(1))
    str=Math.round(tt.minus(wt.multiply(1.5).plus(cv)).abs().value(),0)
  }  
  res=newValue(
    '{time:'+tt.round(3).value()+
    ',congruency:'+str+
    '}','text')
}
res

