var action=$group('Admin.Action.stage','VisionAcuity','Admin.Action.actionType').asSequence()
var res=$group('Admin.Action.stage','VisionAcuity','Admin.Action.eventReason').asSequence().filter(function(v,i){
  return action.indexOf('SKIP')==i
  }).last()
if(res.isNull().not().value()) {
  res=newValue(res.value().slice(14),'text')  
} else {
  var tests=['DONE_VA','DONE_BOTH_VA','DONE_LEFT_VA','DONE_RIGHT_VA','DONE_LEFT_PO_VA','DONE_RIGHT_PO_VA']
  var reasons=['DONE_RSN_VA','DONE_RSN_BOTH_VA','DONE_RSN_LEFT_VA','DONE_RSN_RIGHT_VA','DONE_RSN_LEFT_PO_VA','DONE_RSN_RIGHT_PO_VA']
  for(var i=0;i<tests.length;i++) {
    var t=$('clsa-dcs.VisionAcuity:'+tests[i])
    if(t.any('NO').value()) {
      var r=$('clsa-dcs.VisionAcuity:'+reasons[i]).map({
      'TECHNICAL-PROBLEM':'TechnicalProblem',
      'PARTICIPANT-DECISION':'ParticipantDecision',
      'INTERVIEWER-DECISION':'InterviewerDecision',
      'OTHER':'SeeComment'},null)
      if(r.isNull().not().value()) {
        res=r
        break
      }
    }
  }  
}
res

var count = {RIGHT:0,LEFT:0}
var rtests=['DONE_RIGHT_VA','DONE_RIGHT_PO_VA']
var ltests=['DONE_LEFT_VA','DONE_LEFT_PO_VA']
var n=0
for(var i=0;i<rtests.length;i++) {
  var t=$('clsa-dcs.VisionAcuity:'+rtests[i])
  if(t.isNull().value()) n++
  if(t.any('YES').value()) {
    count['RIGHT']++
  }
  t=$('clsa-dcs.VisionAcuity:'+ltests[i])
  if(t.isNull().value()) n++
  if(t.any('YES').value()) {
    count['LEFT']++
  }
}
var res=null
if(4!=n) {
  res=newValue(
    '{left_test:'+count['LEFT']+
    ',right_test:'+count['RIGHT']+
    '}','text')
}
res

