var res=null
var u=$group('Admin.StageInstance.stage','Phlebotomy','Admin.StageInstance.lastState').asSequence().last()
var v=$group('Admin.StageInstance.stage','Blood','Admin.StageInstance.lastState').asSequence().last()
var w=$group('Admin.StageInstance.stage','Blood2','Admin.StageInstance.lastState').asSequence().last()
var p=$('Admin.StageInstance.stage').any('Phlebotomy').and(w.isNull().not()).value()
var q=$('Admin.StageInstance.stage').any('Blood').and(u.isNull().not()).value()
var r=$('Admin.StageInstance.stage').any('Blood2').and(v.isNull().not()).value()
if(p && !(q || r)) {
  res=newValue( 'Phlebotomy', 'text') 
} else if(q && !(p || r)) {
  res=newValue( 'Blood', 'text') 
} else if(r && !(p || q)) {
  res=newValue( 'Blood2', 'text') 
} else if(p || q || r) {
  var s=[]
  var n=['Phlebotomy','Blood','Blood2']
  if(p) s.push(u)
  if(q) s.push(v)
  if(r) s.push(w)
  var x=[]
  var y=[]
  for(var i=0;i<s.length; i++) {
    if(s[i].any('Completed').value()) x.push(n[i])
    if(s[i].any('NotApplicable').value()) y.push(n[i])
  }
  if(0<x.length) {
    res=newValue(x[x.length-1],'text')
  } else if(0<y.length) {
    res=newValue(y[y.length-1],'text')
  }
}
res

